7¶U<?php exit; ?>a:1:{s:7:"content";s:789:"<p>Elizabeth has experience working within community, hospital and university clinic settings which have afforded her the opportunity to work with a broad range of psychological concerns including: depression, anxiety, adjustment difficulties, stress, self-harm, weight loss, behavioural difficulties and psychological issues associated with cancer.</p>
                <p>She enjoys working with children and adults and utilises Cognitive Behavioural Therapy and Acceptance and Commitment Therapy. Her research interests include the utility of parenting programs for behavioural difficulties and adjustment issues surrounding caregiver of individuals with Brain Tumour.</p>
                <p>In her spare time Elizabeth enjoys watching movies, reading and catching up with friends.</p>";}